window.bookSummaryJSON = "<p>Discover the secret behind <i>The Secret</i> and become a master of manifesting everything and anything you desire using the law of subconscious attraction. In this unique audio series, master hypnotist and best-selling success author Craig Beck reveals the little known techniques required to remove all the problems and obstacles in your life and replace them with the stuff of your dreams. </p> <p>In <i>The Secret Law of Subconscious Attraction</i> you will discover that the universe is currently choosing to ignore many of your hopes, dreams and desires. Craig will explain how you can only get what you want out of life if you also subconsciously believe that you deserve it. Find out how you can ‘flick the switch’ and allow your wants to become beliefs and have the universe automatically deliver your dreams to you. </p> <ul> <li>Easily remove problems and bad habits </li> <li>Attract wealth and abundance </li> <li> Improve your relationships </li> <li>Gain health and fitness </li> <li>Develop a positive mental attitude </li> <li>Find happiness and peace of mind </li> <li>Create the life of your dreams </li> </ul> <p></p>"; 
